INSERT INTO `CMSPROPERTYDATA` VALUES (1,1050,'f788ec72-6a27-4d0a-8d25-3e98365804a2',28,NULL,NULL,NULL,'\r\n<p>The Simple Starter Kit gives you a bare-bones website that\r\nintroduces you to a set of well-defined conventions for building an\r\nUmbraco website.</p>\r\n\r\n<p>The Simple website is very basic in form and provided without\r\nany design or functionality - unless you add a Skin, of course. By\r\ninstalling the Simple Starter Kit, you\'ll begin with a minimal site\r\nbuilt on best practices. You\'ll also enjoy the benefits of speaking\r\nthe same \"language\" as the rest of the Umbraco community by using\r\ncommon properties and naming conventions.</p>\r\n\r\n<p>Now that you know what the Simple site is, it is time to get\r\nstarted using Umbraco.</p>\r\n'),(2,1050,'f788ec72-6a27-4d0a-8d25-3e98365804a2',29,NULL,NULL,'Simple website',NULL),(3,1050,'f788ec72-6a27-4d0a-8d25-3e98365804a2',30,NULL,NULL,NULL,'Off to a great start'),(10,1050,'709108c0-4349-4aad-99a9-d189c24f9fbb',28,NULL,NULL,NULL,'\r\n<p>The Simple Starter Kit gives you a bare-bones website that\r\nintroduces you to a set of well-defined conventions for building an\r\nUmbraco website.</p>\r\n\r\n<p>The Simple website is very basic in form and provided without\r\nany design or functionality - unless you add a Skin, of course. By\r\ninstalling the Simple Starter Kit, you\'ll begin with a minimal site\r\nbuilt on best practices. You\'ll also enjoy the benefits of speaking\r\nthe same \"language\" as the rest of the Umbraco community by using\r\ncommon properties and naming conventions.</p>\r\n\r\n<p>Now that you know what the Simple site is, it is time to get\r\nstarted using Umbraco.</p>\r\n'),(11,1050,'709108c0-4349-4aad-99a9-d189c24f9fbb',29,NULL,NULL,'Simple website',NULL),(12,1050,'709108c0-4349-4aad-99a9-d189c24f9fbb',30,NULL,NULL,NULL,'Off to a great start'),(28,1050,'961ff163-af4d-49f1-b711-4f492cb60125',28,NULL,NULL,NULL,'<p>The Simple Starter Kit gives you a bare-bones website that introdu