INSERT INTO `CMSTEMPLATE` VALUES (1,1044,1045,'umbHomepage','<%@ Master Language=\"C#\" MasterPageFile=\"~/masterpages/umbMaster.Master\" AutoEventWireup=\"true\" %>\n<asp:Content ContentPlaceHolderID=\"cp_content\" runat=\"server\">\n  <div id=\"content\" class=\"frontPage\">\n    <umbraco:Item runat=\"server\" field=\"bodyText\"/>\n  </div>\n</asp:Content>'),(2,1045,NULL,'umbMaster','<%@ Master Language=\"C#\" MasterPageFile=\"~/umbraco/masterpages/default.Master\" AutoEventWireup=\"true\" %>\n<asp:Content ContentPlaceHolderID=\"ContentPlaceHolderDefault\" runat=\"server\">\n\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Strict//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd\"[]>\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n  <head id=\"head\" runat=\"server\">\n  \n  <meta http-equiv=\"Content-Type\" content=\"text/html; charset=iso-8859-1\" />\n  <title><asp:placeholder runat=\"server\"><umbraco:Item runat=\"server\" field=\"pageName\" /> - <umbraco:Item runat=\"server\" field=\"siteName\" recursive=\"true\" /></asp:placeholder></title>\n  \n  <link rel=\"stylesheet\" type=\"text/css\" href=\"/css/Starterkit.css\" />\n  \n  <umbraco:Macro Alias=\"BlogRssFeedLink\" runat=\"server\"></umbraco:Macro>\n  \n  <asp:contentplaceholder id=\"cp_head\" runat=\"server\" />\n</head>\n  <body>\n    <div id=\"main\">\n      <form id=\"RunwayMasterForm\" runat=\"server\">\n        <asp:contentplaceholder id=\"cp_top\" runat=\"server\">\n          <div id=\"top\">\n            <h1 id=\"siteName\"><a href=\"/\"><umbraco:Item runat=\"server\" field=\"siteName\" recursive=\"true\" /></a></h1>\n            <h2 id=\"siteDescription\"><umbraco:Item runat=\"server\" field=\"siteDescription\" recursive=\"true\" /></h2>\n            <asp:LoginStatus runat=\"server\" cssClass=\"loginStatus\" />\n            <umbraco:Macro Alias=\"umbTopNavigation\" runat=\"server\" />\n          </div>\n        </asp:contentplaceholder>\n        \n        <div id=\"body\" class=\"clearfix\">\n          <asp:ContentPlaceHolder ID=\"cp_content\" runat=\"server\"></asp:ContentPlaceHolder>\n        </div>\n      </form>\n      \n      <asp:contentplaceholder id=\"cp_footer\" runat=\"server\">\n        <div id=\"footer\"></div>\n      </asp:contentplaceholder>\n    </div>\n  </body>\n</html>\n</asp:content>\n'),(3,1046,1045,'umbTextpage','<%@ Master Language=\"C#\" MasterPageFile=\"~/masterpages/umbMaster.master\" AutoEventWireup=\"true\" %>\r\n<asp:Content ContentPlaceHolderID=\"cp_content\" runat=\"server\">\r\n\r\n<div id=\"content\" class=\"textpage\">\r\n  \r\n      <div id=\"contentHeader\">  \r\n          <h2><umbraco:Item runat=\"server\" field=\"pageName\"/></h2>\r\n      </div>\r\n      \r\n      <umbraco:Item runat=\"server\" field=\"bodyText\" />\r\n</div>\r\n\r\n<div id=\"subNavigation\">\r\n      <umbraco:Macro Alias=\"umb2ndLevelNavigation\" runat=\"server\"></umbraco:Macro>\r\n</div>\r\n  \r\n\r\n</asp:Content>'),(4,1054,1045,'CategoryPage','<%@ Master Language=\"C#\" MasterPageFile=\"~/masterpages/umbMaster.Master\" AutoEventWireup=\"true\" %>\n\n<asp:content ContentPlaceHolderId=\"cp_content\" runat=\"server\">\n  <umbraco:Item field=\"categoryName\" runat=\"server\" />\n  <umbraco:Macro Alias=\"umb2ndLevelNavigation\" runat=\"server\"></umbraco:Macro>\n</asp:content>\n\n<asp:content ContentPlaceHolderId=\"cp_footer\" runat=\"server\">\n  <umbraco:Item field=\"createDate\" runat=\"server\" />\n</asp:content>'),(5,1055,1045,'ProductPage','<%@ Master Language=\"C#\" MasterPageFile=\"~/masterpages/umbMaster.Master\" AutoEventWireup=\"true\" %>\n\n<asp:content ContentPlaceHolderId=\"cp_content\" runat=\"server\">\n  <h3>\n    <umbraco:Item field=\"productName\" runat=\"server\" />\n  </h3>\n  <p>\n    Price: &#36; <umbraco:Item field=\"productPrice\" runat=\"server\" />\n  </p>\n  <p>\n    <h4>Description</h4>\n    <umbraco:Item field=\"productDescription\" runat=\"server\" />\n  </p>\n  <div>\n    <umbraco:Macro ImageContentId=\"[#productImage]\" Alias=\"CmsStoreImageControl\" runat=\"server\" />\n  </div>\n  <hr/>\n  <h3>Reviews</h3>\n  <umbraco:Macro LoginUrl=\"~/cms-store/login\" Alias=\"ReviewControl\" runat=\"server\"></umbraco:Macro>\n</asp:content>\n\n<asp:content ContentPlaceHolderId=\"cp_footer\" runat=\"server\">\n  \n</asp:content>'),(6,1068,1045,'LoginPage','<%@ Master Language=\"C#\" MasterPageFile=\"~/masterpages/umbMaster.Master\" AutoEventWireup=\"true\" %>\n\n<asp:content ContentPlaceHolderId=\"cp_content\" runat=\"server\">\n  <umbraco:Macro RegisterUrl=\"~/cms-store/register\" Alias=\"LoginControl\" runat=\"server\"></umbraco:Macro>\n</asp:content>'),(7,1069,1045,'RegisterPage','<%@ Master Language=\"C#\" MasterPageFile=\"~/masterpages/umbMaster.Master\" AutoEventWireup=\"true\" %>\n\n<asp:content ContentPlaceHolderId=\"cp_head\" runat=\"server\">\n	\n</asp:content>\n\n<asp:content ContentPlaceHolderId=\"cp_top\" runat=\"server\">\n	\n</asp:content>\n\n<asp:content ContentPlaceHolderId=\"cp_content\" runat=\"server\">\n	\n</asp:content>\n\n<asp:content ContentPlaceHolderId=\"cp_footer\" runat=\"server\">\n	\n</asp:content>\n\n');
